B.Ve=new A.S("To begin playing, simply press the 'Start Game' button and select the game mode (in this first version, only Singleplayer mode is available). Next, you can choose the role you want to play:\n\nOnce you've chosen your game mode, you can configure your game. You'll need to provide a brief description of the story's setting that you want to follow (including the condition to end the game) and create your character sheet. Don't worry if you have no experience with this; the game can generate a character sheet for you\u2014it does it all! (Currently, the game only provides auto-generated character sheets.)\n\nAfter this, if you have enough tokens to play, you can start your new campaign!\n\n",null,B.z,null,null,null,null,null,null,null,null)
