B.VZ=new A.S("This part is important. Since it's an AI that's responsible for guiding the game, and not a human, all players must commit to following certain guidelines to facilitate the flow of the game:\n\nAdhere to your character sheet: Remember your character's details and incorporate them into the conversation whenever possible to provide more context to the AI. Don't change your character's details unless instructed to do so.\n\nDon't make up dice rolls: The natural mechanism for role-playing is dice rolls. If you're asked to make a roll, don't make up the values. Embrace the randomness!\n\nKeep the AI in context: We trust you to follow the story provided by the AI. After all, it's not human. Correct when necessary, make decisions your character would make, and forge your own path, but don't diverge into unrelated topics. You might confuse the AI and disrupt the narrative.\n\nNo cheating: We appeal to the goodwill of our players. If things go awry, don't hesitate to help the AI remember certain decisions and aspects of your character sheet.\n\nBehave as you would with your trusted Game Master: It's each player's responsibility to ensure it's an enjoyable and easy-to-follow game.\n\nDisclaimer: Since it's an external conversational AI, we're not responsible for the content of the conversations. We trust in you!",null,B.z,null,null,null,null,null,null,null,null)
